(1, 'logo-header', 'logo_jdihn.png', 'logo_jdih.png', 'index'),
(2, 'instansi', 'JDIH NAMA INSTANSI', 'nama instansi', 'index'),
(3, 'timpengelola', '<h4 style=\"color: rgb(0, 0, 0);\">SK Tim Pengelola JDIH</h4><ul><li><p><a href=\"http://localhost/ildis-v3nov24/common/dokumen/tes.pdf\">Peraturan Presiden Nomor 33 Tahun 2012 tentang Jaringan Dokumentasi dan Jaringan Informasi Hukum Nasional</a></p></li></ul>', 'logo_footer.png', 'tentang-kami'),
(4, 'deskripsi-footer', '<ul class=\"list-unstyled\" style=\"margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><li style=\"margin-bottom: 10px;\">Gedung JDIHN</li></ul>', '   <p>JDIHN adalah wadah pendayagunaan bersama atas dokumen hukum secara tertib, terpadu, dan berkesinambungan, serta merupakan sarana pemberian pelayanan informasi hukum secara lengkap, akurat, mudah dan cepat. Keberadaan sebuah wadah yang dapat menyajikan informasi hukum dan data produk hukum yang berlaku yang selalu diperbarui menjadi sesuatu yang sangat dibutuhkan.</p>', 'footer'),
(5, 'kontak-alamat-footer', '<p>Badan Pembinaan Hukum Nasional&nbsp; &nbsp; &nbsp; &nbsp; </p><p>Jl. Mayjend Soetoyo No. 10, Cililitan-Jakarta Timur</p>', 'Ganti alamat instansi', 'footer'),
(6, 'kontak-nomor-footer', '(021) -', 'Ganti nomor instansi', 'footer'),
(7, 'kontak-email-footer', 'nama@instansi.go.id', 'Ganti email instansi', 'footer'),
(8, 'sekilas-sejarah', '        <h4>Sekilas Sejarah JDIH Instansi</h4>\r\n        <p class=\"margin-30px-bottom sm-margin-20px-bottom\">Pembentukan Jaringan Dokumentasi dan Informasi Hukum Nasional (JDIHN), secara historis merupakan salah satu rekomendasi dari kegiatan pembangunan hukum nasional yaitu Seminar Hukum Nasional III tahun 1974 di Surabaya yang diselenggarakan oleh Badan Pembinaan Hukum. Hasil seminar menilai dokumentasi hukum terhadap pembangunan hukum nasional masih sangat lemah karena belum mampu menyediakan dokumen dan informasi hukum serta sistem temu kembali dengan cepat dan tepat pada saat dibutuhan.</p>\r\n        <p class=\"margin-30px-bottom sm-margin-20px-bottom\">Hasil lain dari Seminar Hukum Nasional III Tahun 1974, ditemukan faktor penyebab lemahnya dukungan dokumentasi hukum antara lain adalah:</p>\r\n\r\n        <ol class=\"ml-3\">\r\n            <li>Dokumen hukum potensial, tersebar luas di instansi pemerintah di pusat sampai daerah dengan wilayah kepulauan yang sangat luas;</li>\r\n            <li>Dokumen-dokumen hukum tersebut belum semuanya dikelola dengan baik dalam suatu sistem; </li>\r\n            <li>Tenaga pengelola yang ada sangat kurang;</li>\r\n            <li>Kurangnya perhatian terhadap keberadaan dokumentasi dan perpustakaan hukum.</li>\r\n        </ol>\r\n        <p class=\"margin-30px-bottom sm-margin-20px-bottom\">Seminar juga merekomendasikan:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Membentuk kerja sama antar unit pengelola dokumen hukum dalam suatu Jaringan dokumentasi dan informasi hukum </li>\r\n            <li>Perlu adanya suatu kebijakan nasional untuk mulai menyusun sistem jaringan dokumentasi dan informasi hukum dan agar segera dapat berfungsi.</li>\r\n            <li>Dalam tahap permulaan ada dua hal yang perlu dilakukan:\r\n                <ol type=\"a\">\r\n                    <li>mempermudah pencarian dan penemuan kembali peraturan perundang- undangan, yurisprudensi, serta bahan-bahan lainnya</li>\r\n                    <li>Untuk dapat secepatnya mendayagunakan semua informasi yang ada Sistem Jaringan Dokumentasi dan Informasi Hukum perlu disusun dan dikembangkan. Ditentukan Pusat dan Anggota Jaringan serta menyediakan sarana yang diperlukan agar mulai berfungsi.</li>\r\n                </ol>\r\n            </li>\r\n        </ol>\r\n        <p>Pada tahun 1978 dilaksanakan Lokakarya tentang “Organisasi dan Komunikasi Sistem Jaringan Dokumentasi dan Informasi Hukum” di Jakarta, yang salah satu hasilnya adalah menunjuk BPHN sebagai Pusat Jaringan dan diberi tugas sebagai penyelenggara latihan pembinaan tenaga, tempat konsultasi, penelitian dan pengembangan sistem jaringan, serta koordinator kegiatan unit-unit jaringan dalam rangka pengembangan jaringan.</p>\r\n        <p>Dalam rangka melaksanakan tugas sebagai Pusat JDIH, pada tahun 1988 BPHN mengeluarkan pedoman pengelolaaan dokumen hukum yang diberi nama ”Manual Unit Jaringan Dokumentasi dan Informasi Hukum” yang terdiri dari V modul yaitu:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Modul I: Pedoman Prosedur Kerja Pusat Jaringan Dokumentasi dan Informasi Hukum.</li>\r\n            <li>Modul II: Pedoman Pengumpulan Bahan (Kegiatan Prakatalogan).</li>\r\n            <li>Modul III: Pedoman Pengolahan Sub-Modul IIIA: Pedoman Teknis Pengkatalogan Bahan Pustaka dan Pascakatalogan (berdasarkan UDC); Sub-Modul IIIB: Pedoman Teknis Pengkatalogan Peraturan Perundang-undangan; Sub-Modul IIIC: Pedoman Teknis Pengkatalogan Bahan Pustaka dan Pascakatalogan (berdasarkan DDC).</li>\r\n            <li>Modul IV: Pedoman Peelayaan Informasi;</li>\r\n            <li>Modul V: Sarana Kerja Unit Jaringan Dokumentasi dan Informasi Hukum</li>\r\n        </ol>\r\n        <p>Pada Tahun 1999 terbit Kebijakan Nasional terkait pelaksanaan JDIHN, yaitu Keputusan Presiden Nomor 91 Tahun 1999 tentang Jaringan Dokumentasi dan Informasi Hukum Nasional dalam Lembaran Negara No. 135. Kemudian dalam upaya menjamin terciptanya Pengelolaan Dokumentasi dan Informasi Hukum yang terpadu dan terintegrasi maka Keputusan Presiden tersebut direvitalisasi dan diganti dengan Peraturan Presiden Nomor 33 Tahun 2012 tentang Jaringan Dokumentasi dan Informasi Hukum Nasional yang salah satu tugasnya adalah melakukan pembinaan, pengembangan dan monitoring pada anggota JDIHN yang terdiri dari:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Biro Hukum dan/atau unit kerja yang tugas dan fungsinya menyelenggarakan kegiatan yang berkaitan dengan dokumen hukum pada:\r\n                <ol type=\"a\">\r\n                    <li>Kementerian Negara;</li>\r\n                    <li>Sekretariat Lembaga Negara;</li>\r\n                    <li>Lembaga Pemerintah Non Kementerian;</li>\r\n                    <li>Pemerintah Provinsi;</li>\r\n                    <li>Pemerintah Kabupaten/Kota; dan</li>\r\n                    <li>Sekretariat Dewan Perwakilan Rakyat Daerah Tingkat Provinsi dan Kabupaten/Kota.</li>\r\n                </ol>\r\n            </li>\r\n            <li>Perpustakaan pada perguruan tinggi negeri dan perguruan tinggi swasta;</li>\r\n            <li>Lembaga Lain yang bergerak di bidang pengembangan dokumentasi dan informasi hukum yang ditetapkan olen Menteri.</li>\r\n            <p>Selain itu, amanat pada Peraturan Presiden Nomor 33 Tahun 2012 menegaskan bahwa tujuan dari JDIHN adalah:</p>\r\n            <ol type=\"a\">\r\n                <li>menjamin terciptanya Pengelolaan Dokumentasi dan Informasi Hukum yang terpadu dan terintegrasi di berbagai instansi pemerintah dan institusi lainnya;</li>\r\n                <li>menjamin ketersediaan dokumentasi dan informasi hukum yang lengkap dan akurat, serta dapat diakses secara cepat dan mudah;</li>\r\n                <li>mengembangkan kerja sama yang efektif antara Pusat jaringan dan Anggota jaringan serta antar sesama Anggota jaringan dalam rangka penyediaan dokumentasi dan informasi hukum; dan</li>\r\n                <li>meningkatkan kualitas pembangunan hukum nasional dan pelayanan kepada publik sebagai salah satu wujud ketatapemerintahan yang baik, transparan, efektif, efisien, dan bertanggung jawab.</li>\r\n            </ol>\r\n        </ol>\r\n        <p>Untuk menyesuaikan dengan perkembangan ilmu pengetahuan dan teknologi, Manual Unit Jaringan Dokumentasi dan Informasi Hukum juga telah direvisi dan dikembangkan oleh Pusat JDIHN dan dijadikan lampiran yang tidak terpisahkan dari Peraturan Menteri Hukum dan HAM Nomor 02 Tahun 2013 Tentang Standardisasi Pengelolaan Teknis Dokumentasi Dan Informasi Hukum, yang selanjutnya dicabut dengan Peraturan Menteri Hukum dan HAM Nomor 8 Tahun 2019 Tentang Standar Pengelolaan Dokumen dan Informasi Hukum, ini dimaksudkan sebagai pedoman yang wajib digunakan oleh Anggota JDIHN. Standar Pengelolaan Dokumen dan Informasi Hukum meliputi:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Standar Pembuatan Abstrak Peraturan Perundang-undangan;</li>\r\n            <li>Standar Pengolahan Dokumen dan Informasi Hukum;</li>\r\n            <li>Standar Laporan Evaluasi Pengelolaan Jaringan Dokumentasi dan Informasi Hukum Nasional</li>\r\n        </ol>\r\n        <p>Sejarah pembentukan JDIHN di atas menunjukkan betapa pentingnya kerjasama pengelolaan dokumen dan informasi hukum untuk mempercepat pembangunan hukum nasional yang berkualitas. Oleh karena itu, untuk membangun akses informasi hukum yang terintegrasi, secara nasional semua Anggota JDIHN wajib mengelola dokumen dan informasi hukum yang ada dalam kewenangannya dengan menggunakan modul/standar yang ada dan meningkatkan akselerasinya dengan memanfaatkan kecanggihan teknologi informasi dan komunikasi.</p>', '        <h4>Sekilas Sejarah</h4>\r\n        <p class=\"margin-30px-bottom sm-margin-20px-bottom\">Pembentukan Jaringan Dokumentasi dan Informasi Hukum Nasional (JDIHN), secara historis merupakan salah satu rekomendasi dari kegiatan pembangunan hukum nasional yaitu Seminar Hukum Nasional III tahun 1974 di Surabaya yang diselenggarakan oleh Badan Pembinaan Hukum. Hasil seminar menilai dokumentasi hukum terhadap pembangunan hukum nasional masih sangat lemah karena belum mampu menyediakan dokumen dan informasi hukum serta sistem temu kembali dengan cepat dan tepat pada saat dibutuhan.</p>\r\n        <p class=\"margin-30px-bottom sm-margin-20px-bottom\">Hasil lain dari Seminar Hukum Nasional III Tahun 1974, ditemukan faktor penyebab lemahnya dukungan dokumentasi hukum antara lain adalah:</p>\r\n\r\n        <ol class=\"ml-3\">\r\n            <li>Dokumen hukum potensial, tersebar luas di instansi pemerintah di pusat sampai daerah dengan wilayah kepulauan yang sangat luas;</li>\r\n            <li>Dokumen-dokumen hukum tersebut belum semuanya dikelola dengan baik dalam suatu sistem; </li>\r\n            <li>Tenaga pengelola yang ada sangat kurang;</li>\r\n            <li>Kurangnya perhatian terhadap keberadaan dokumentasi dan perpustakaan hukum.</li>\r\n        </ol>\r\n        <p class=\"margin-30px-bottom sm-margin-20px-bottom\">Seminar juga merekomendasikan:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Membentuk kerja sama antar unit pengelola dokumen hukum dalam suatu Jaringan dokumentasi dan informasi hukum </li>\r\n            <li>Perlu adanya suatu kebijakan nasional untuk mulai menyusun sistem jaringan dokumentasi dan informasi hukum dan agar segera dapat berfungsi.</li>\r\n            <li>Dalam tahap permulaan ada dua hal yang perlu dilakukan:\r\n                <ol type=\"a\">\r\n                    <li>mempermudah pencarian dan penemuan kembali peraturan perundang- undangan, yurisprudensi, serta bahan-bahan lainnya</li>\r\n                    <li>Untuk dapat secepatnya mendayagunakan semua informasi yang ada Sistem Jaringan Dokumentasi dan Informasi Hukum perlu disusun dan dikembangkan. Ditentukan Pusat dan Anggota Jaringan serta menyediakan sarana yang diperlukan agar mulai berfungsi.</li>\r\n                </ol>\r\n            </li>\r\n        </ol>\r\n        <p>Pada tahun 1978 dilaksanakan Lokakarya tentang “Organisasi dan Komunikasi Sistem Jaringan Dokumentasi dan Informasi Hukum” di Jakarta, yang salah satu hasilnya adalah menunjuk BPHN sebagai Pusat Jaringan dan diberi tugas sebagai penyelenggara latihan pembinaan tenaga, tempat konsultasi, penelitian dan pengembangan sistem jaringan, serta koordinator kegiatan unit-unit jaringan dalam rangka pengembangan jaringan.</p>\r\n        <p>Dalam rangka melaksanakan tugas sebagai Pusat JDIH, pada tahun 1988 BPHN mengeluarkan pedoman pengelolaaan dokumen hukum yang diberi nama ”Manual Unit Jaringan Dokumentasi dan Informasi Hukum” yang terdiri dari V modul yaitu:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Modul I: Pedoman Prosedur Kerja Pusat Jaringan Dokumentasi dan Informasi Hukum.</li>\r\n            <li>Modul II: Pedoman Pengumpulan Bahan (Kegiatan Prakatalogan).</li>\r\n            <li>Modul III: Pedoman Pengolahan Sub-Modul IIIA: Pedoman Teknis Pengkatalogan Bahan Pustaka dan Pascakatalogan (berdasarkan UDC); Sub-Modul IIIB: Pedoman Teknis Pengkatalogan Peraturan Perundang-undangan; Sub-Modul IIIC: Pedoman Teknis Pengkatalogan Bahan Pustaka dan Pascakatalogan (berdasarkan DDC).</li>\r\n            <li>Modul IV: Pedoman Peelayaan Informasi;</li>\r\n            <li>Modul V: Sarana Kerja Unit Jaringan Dokumentasi dan Informasi Hukum</li>\r\n        </ol>\r\n        <p>Pada Tahun 1999 terbit Kebijakan Nasional terkait pelaksanaan JDIHN, yaitu Keputusan Presiden Nomor 91 Tahun 1999 tentang Jaringan Dokumentasi dan Informasi Hukum Nasional dalam Lembaran Negara No. 135. Kemudian dalam upaya menjamin terciptanya Pengelolaan Dokumentasi dan Informasi Hukum yang terpadu dan terintegrasi maka Keputusan Presiden tersebut direvitalisasi dan diganti dengan Peraturan Presiden Nomor 33 Tahun 2012 tentang Jaringan Dokumentasi dan Informasi Hukum Nasional yang salah satu tugasnya adalah melakukan pembinaan, pengembangan dan monitoring pada anggota JDIHN yang terdiri dari:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Biro Hukum dan/atau unit kerja yang tugas dan fungsinya menyelenggarakan kegiatan yang berkaitan dengan dokumen hukum pada:\r\n                <ol type=\"a\">\r\n                    <li>Kementerian Negara;</li>\r\n                    <li>Sekretariat Lembaga Negara;</li>\r\n                    <li>Lembaga Pemerintah Non Kementerian;</li>\r\n                    <li>Pemerintah Provinsi;</li>\r\n                    <li>Pemerintah Kabupaten/Kota; dan</li>\r\n                    <li>Sekretariat Dewan Perwakilan Rakyat Daerah Tingkat Provinsi dan Kabupaten/Kota.</li>\r\n                </ol>\r\n            </li>\r\n            <li>Perpustakaan pada perguruan tinggi negeri dan perguruan tinggi swasta;</li>\r\n            <li>Lembaga Lain yang bergerak di bidang pengembangan dokumentasi dan informasi hukum yang ditetapkan olen Menteri.</li>\r\n            <p>Selain itu, amanat pada Peraturan Presiden Nomor 33 Tahun 2012 menegaskan bahwa tujuan dari JDIHN adalah:</p>\r\n            <ol type=\"a\">\r\n                <li>menjamin terciptanya Pengelolaan Dokumentasi dan Informasi Hukum yang terpadu dan terintegrasi di berbagai instansi pemerintah dan institusi lainnya;</li>\r\n                <li>menjamin ketersediaan dokumentasi dan informasi hukum yang lengkap dan akurat, serta dapat diakses secara cepat dan mudah;</li>\r\n                <li>mengembangkan kerja sama yang efektif antara Pusat jaringan dan Anggota jaringan serta antar sesama Anggota jaringan dalam rangka penyediaan dokumentasi dan informasi hukum; dan</li>\r\n                <li>meningkatkan kualitas pembangunan hukum nasional dan pelayanan kepada publik sebagai salah satu wujud ketatapemerintahan yang baik, transparan, efektif, efisien, dan bertanggung jawab.</li>\r\n            </ol>\r\n        </ol>\r\n        <p>Untuk menyesuaikan dengan perkembangan ilmu pengetahuan dan teknologi, Manual Unit Jaringan Dokumentasi dan Informasi Hukum juga telah direvisi dan dikembangkan oleh Pusat JDIHN dan dijadikan lampiran yang tidak terpisahkan dari Peraturan Menteri Hukum dan HAM Nomor 02 Tahun 2013 Tentang Standardisasi Pengelolaan Teknis Dokumentasi Dan Informasi Hukum, yang selanjutnya dicabut dengan Peraturan Menteri Hukum dan HAM Nomor 8 Tahun 2019 Tentang Standar Pengelolaan Dokumen dan Informasi Hukum, ini dimaksudkan sebagai pedoman yang wajib digunakan oleh Anggota JDIHN. Standar Pengelolaan Dokumen dan Informasi Hukum meliputi:</p>\r\n        <ol class=\"ml-3\">\r\n            <li>Standar Pembuatan Abstrak Peraturan Perundang-undangan;</li>\r\n            <li>Standar Pengolahan Dokumen dan Informasi Hukum;</li>\r\n            <li>Standar Laporan Evaluasi Pengelolaan Jaringan Dokumentasi dan Informasi Hukum Nasional</li>\r\n        </ol>\r\n        <p>Sejarah pembentukan JDIHN di atas menunjukkan betapa pentingnya kerjasama pengelolaan dokumen dan informasi hukum untuk mempercepat pembangunan hukum nasional yang berkualitas. Oleh karena itu, untuk membangun akses informasi hukum yang terintegrasi, secara nasional semua Anggota JDIHN wajib mengelola dokumen dan informasi hukum yang ada dalam kewenangannya dengan menggunakan modul/standar yang ada dan meningkatkan akselerasinya dengan memanfaatkan kecanggihan teknologi informasi dan komunikasi.</p>', 'tentang-kami'),
(9, 'dasar-hukum', '        <h4>Dasar Hukum</h4>\r\n        <ul style=\"margin-bottom: 10px;\">\r\n            <li><a href=\"#\">\r\n                    <p>Peraturan Presiden Nomor 33 Tahun 2012 tentang Jaringan Dokumentasi dan Jaringan Informasi Hukum Nasional</p>\r\n                </a></li>\r\n            <li><a href=\"#\">\r\n                    <p>Peraturan Menteri Hukum dan Hak Asasi Manusia Nomor 8 Tahun 2019 tentang Standar Pengelolaan Dokumen Dan Informasi Hukum</p>\r\n                </a></li>\r\n            <li><a href=\"#\">\r\n                    </a><p><a href=\"#\">Peraturan Menteri Hukum dan Hak Asasi Manusia Nomor 30 Tahun 2013 tentang Jaringan Dokumentasi dan Informasi Hukum di Lingkungan Kementerian Hukum dan Hak Asasi Manusia</a></p></li></ul>', '        <h4>Dasar Hukum</h4>\r\n        <ul>\r\n            <li><a href=\"#\">\r\n                    <p>Peraturan Presiden Nomor 33 Tahun 2012 tentang Jaringan Dokumentasi dan Jaringan Informasi Hukum Nasional</p>\r\n                </a></li>\r\n            <li><a href=\"#\">\r\n                    <p>Peraturan Menteri Hukum dan Hak Asasi Manusia Nomor 8 Tahun 2019 tentang Standar Pengelolaan Dokumen Dan Informasi Hukum</p>\r\n                </a></li>\r\n            <li><a href=\"#\">\r\n                    <p>Peraturan Menteri Hukum dan Hak Asasi Manusia Nomor 30 Tahun 2013 tentang Jaringan Dokumentasi dan Informasi Hukum di Lingkungan Kementerian Hukum dan Hak Asasi Manusia.</p>\r\n                </a></li>\r\n        </ul>', 'tentang-kami'),
(10, 'visi', '<h4>Visi JDIH Instansi</h4>\r\n\r\n<p>Jaringan Dokumentasi dan Informasi Hukum Nasional atau disingakat JDIHN adalah:</p>\r\n\r\n<ul>\r\n   <li>Wadah pendayagunaan bersama atas dokumen hukum secara tertib, terpadu, dan berkesinambungan.</li>\r\n   <li>Merupakan sarana pemberian pelayanan informasi hukum secara lengkap akurat, mudah, dan cepat</li>\r\n</ul>\r\n\r\n<p><strong>VISI</strong></p>\r\n<p>\"Masyarakat memperoleh kepastian hukum\"</p>', '<h4>Visi JDIH BPHN</h4>\r\n\r\n<p>Jaringan Dokumentasi dan Informasi Hukum Nasional atau disingakat JDIHN adalah:</p>\r\n\r\n<ul>\r\n   <li>Wadah pendayagunaan bersama atas dokumen hukum secara tertib, terpadu, dan berkesinambungan.</li>\r\n   <li>Merupakan sarana pemberian pelayanan informasi hukum secara lengkap akurat, mudah, dan cepat</li>\r\n</ul>\r\n\r\n<p><strong>VISI</strong></p>\r\n<p>\"Masyarakat memperoleh kepastian hukum\"</p>', 'tentang-kami'),
(11, 'misi', '<h4>Misi JDIH Instansi</h4>\r\n    <p>Jaringan Dokumentasi dan Informasi Hukum Nasional atau disingakat JDIHN adalah:</p>\r\n    <ul>\r\n      <li>Wadah pendayagunaan bersama atas dokumen hukum secara tertib, terpadu, dan berkesinambungan.</li>\r\n      <li>Merupakan sarana pemberian pelayanan informasi hukum secara lengkap akurat, mudah, dan cepat</li>\r\n    </ul>\r\n\r\n    <p><strong>MISI</strong></p>\r\n\r\n    <p>\"Mewujudkan peraturan Perundang-Undangan yang berkualitas\"</p>', '<h4>Misi JDIH BPHN</h4>\r\n    <p>Jaringan Dokumentasi dan Informasi Hukum Nasional atau disingakat JDIHN adalah:</p>\r\n    <ul>\r\n      <li>Wadah pendayagunaan bersama atas dokumen hukum secara tertib, terpadu, dan berkesinambungan.</li>\r\n      <li>Merupakan sarana pemberian pelayanan informasi hukum secara lengkap akurat, mudah, dan cepat</li>\r\n    </ul>\r\n\r\n    <p><strong>MISI</strong></p>\r\n\r\n    <p>\"Mewujudkan peraturan Perundang-Undangan yang berkualitas\"</p>', 'tentang-kami'),
