INSERT INTO `makna_logo` (`id`, `image`, `isi`, `status`) VALUES
(12, 'logo5db7ad2a33544.png', '<ul>\r\n	<li>6 garis menggambarkan aspek dari JDIH.\r\n	<ul>\r\n		<li>Garis paling besar adalah organisasi.</li>\r\n		<li>Lalu diikuti oleh aspek SDM, Koleksi Dokumen Hukum, Teknis Pengelolaan, Sarana Prasarana, dan Pemanfaatan TIK</li>\r\n	</ul>\r\n	</li>\r\n	<li>Dibuat melingkar seperti bola dunia untuk menggambarkan wadah dan jaringan (networking).</li>\r\n	<li>Warna biru menyiratkan profesionalisme, pemikiran yang serius, integritas, ketulusan dan ketenangan. Biru juga di asosiasikan dengan otoritas, komunikasi dan inovasi teknologi.</li>\r\n</ul>', 1),
(13, 'logo5db7add4474bb.png', '<ul>\r\n	<li>Tulisan JDIHN menggambarkan identitas Pusat JDIH Nasional (sebagai wadah pendayagunaan dokumen hukum secara tertib, terpadu, dan berkesinambungan serta merupakan sarana pemberian pelayanan informasi hukum secara mudah, cepat, dan akurat).</li>\r\n	<li>Warna MERAH bermakna dinamis, berani dan percaya diri.</li>\r\n</ul>', 1),
(14, 'logo5db7ae20eeff7.png', '<ul>\r\n	<li>pulau menggambarkan semua anggota jaringan berada di Negara Kesatuan Republik Indonesia.</li>\r\n	<li>Warna HIJAU bermakna kesuburan.</li>\r\n</ul>', 1);
