INSERT INTO `sejarah` (`id`, `isi`, `status`) VALUES
(30, '<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Ide membentuk Jaringan Dokumentasi dan Informasi Hukum Nasional (JDIHN), secara historis melekat erat dengan pembangunan hukum nasional dalam upaya mewujudkan supremasi hukum. Dikatakan demikian karena embrio pembentukan JDIHN adalah salah satu rekomendasi dari kegiatan pembangunan hukum nasional yaitu Seminar Hukum Nasional III tahun 1974 di Surabaya. Seminar hukum tersebut diselenggarakan oleh Badan Pembinaan Hukum Nasional dalam upaya membedah semua unsur pembangunan hukum dalam rangka mengingidentifikasi permasalahan dan menemukan solusi pemecahannya.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Pada saat membedah dokumentasi hukum, para peserta seminar mengetahui bahwa dukungan dokumentasi hukum terhadap pembangunan hukum nasional masih sangat lemah. Dokumentasi hukum belum mampu menyediakan dokumen dan informasi hukum dengan cepat dan tepat pada saat dibutuhan. Dokumentasi hukum belum mampu menyediakan akses informasi hukum yang efektip, sehingga dokumen/informasi hukum sulit dicari dan ditemukan kembali pada saat dibutuhkan untuk mendukung pelaksanaan kegiatan pembangunan hukum, seperti: penelitian hukum, perencanaan hukum, penyusunan naskah akademis, penyusunan rancangan peraturan perundang-undangan, pembentukan kebijakan pimpinan dan lain-lain.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Berdasarkan pengamatan peserta Seminar Hukum Nasional III Tahun 1974, faktor penyebab lemahnya dukungan dokumentasi hukum antara lain adalah:</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Dokumen hukum potensial, tersebar luas di instansi pemerintah di pusat sampai daerah dengan wilayah kepulauan yang sangat luas;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Dokumen-dokumen hukum tersebut belum semuanya dikelola dengan baik dalam suatu sistem; 3. Tenaga pengelola yang ada sangat kurang;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Perhatian terhadap keberadaan dokumentasi dan perpustakaan hukum masih sangat kurang.</span></li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Peserta seminar berpendapat bahwa cara yang paling epektif untuk mengatasi kelemahan dokumentasi hukum ini adalah membentuk kerja sama antar unit pengelola dokumen hukum itu sendiri dalam suatu Jaringan dokumentasi dan informasi hukum.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Berdasarkan pemikiran tersebut seminar merekomendasikan:</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Perlu adanya suatu kebijakan nasional untuk mulai menyusun sistem jaringan dokumentasi dan informasi hukum dan agar segera dapat berfungsi.</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Dalam tahap permulaan ada dua hal yang perlu dilakukan:</span>\r\n	<ol style=\"list-style-type:lower-alpha;\">\r\n		<li><span style=\"color:#000000;\">mempermudah pencarian dan penemuan kembali peraturan perundang- undangan, yurisprudensi, serta bahan-bahan lainnya</span></li>\r\n		<li><span style=\"color:#000000;\">Untuk dapat secepatnya mendayagunakan semua informasi yang ada Sistem Jaringan Dokumentasi dan Informasi Hukum perlu disusun dan dikembangkan. Ditentukan Pusat dan Anggota Jaringan serta menyediakan sarana yang diperlukan agar mulai berfungsi.</span></li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Sambil menunggu terbitnya kebijakan nasional termaksud, BPHN (Badan Pembinaan Hukum Nasional) sebagai pengemban tugas pembinaan hukum nasional, segera menyelenggarakan serangkaian lokakarya dan berhasil mempersiapkan sarana (infrastruktur) jaringan agar bisa operasional. Lokakarya tersebut adalah Lokakarya tentang : &ldquo;Jaringan Dokumentasi dan Informasi Hukum&rdquo; di Jakarta (1975); Lokakarya tentang &ldquo;Sistem Penemuan Kembali Peraturan Perundang-undangan&rdquo; di Malang (1977); Lokakarya tentang &ldquo;Sistem Penyebarluasan Peraturan Perundang-undangan&rdquo; di Pontianak (1977); Lokakarya tentang &ldquo;Organisasi dan Komunikasi Sistem Jaringan Dokumentasi dan Informasi Hukum&rdquo; di Jakarta (1978),</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Lokakarya Tahun 1978 sepakat menunjuk BPHN sebagai Pusat Jaringan dan diberi tugas sebagai penyelenggara latihan pembinaan tenaga, tempat konsultasi, penelitian dan pengembangan sistem jaringan, serta koordinator kegiatan unit-unit jaringan dalam rangka pengembangan jaringan. Dalam rangka melaksanakan tugas tersebut pada tahun 1988 BPHN sebagai Pusat JDIH mengeluarkan pedoman pengelolaaan dokumen hukum yang diberi nama &rdquo;Manual Unit Jaringan Dokumentasi dan Informasi Hukum&rdquo; yang terdiri dari IV modul yaitu:</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Modul I: Pedoman Prosedur Kerja Pusat Jaringan Dokumentasi dan Informasi Hukum.</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Modul II: Pedoman Pengumpulan Bahan (Kegiatan Prakatalogan).</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Modul III: Pedoman Pengolahan Sub-Modul IIIA: Pedoman Teknis Pengkatalogan Bahan Pustaka dan Pascakatalogan (berdasarkan UDC); Sub-Modul IIIB: Pedoman Teknis Pengkatalogan Peraturan Perundang-undangan; Sub-Modul IIIC: Pedoman Teknis Pengkatalogan Bahan Pustaka dan Pascakatalogan (berdasarkan DDC).</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Modul IV: Pedoman Peelayaan Informasi;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Modul V: Sarana Kerja Unit Jaringan Dokumentasi dan Informasi Hukum</span></li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Dari tahun 1978 &ndash; 1999, BPHN melakukan pembinaan dan pengembangan JDIH hanya berdasarkan kesepakatan tersebut. Banyak upaya pembinaan dan pengembangan yang telah dilakukan, namun temu kembali informasi belum dapat dilakukan dengan cepat, tepat, dan pendayagunaan informasi belum dapat terselenggara dengan baik.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Selama Pemerintahan Orde Baru rekomendasi untuk membentuk JDIHN kurang mendapat perhatian. Jaringan Dokumentasi dan Informasi Hukum disebut dalam GBHN 1993 bidang pembangunan hukum sektor sarana dan prasarana sebagai sarana penunjang pembangunan hukum. Namun dalam era Pemerintahan Reformasi rekomendasi termaksud langsung diwujudkan dengan mengundangkan Keputusan Presiden Nomor 91 Tahun 1999 tentang Jaringan Dokumentasi dan Informasi Hukum Nasional dalam Lembaran Negara No. 135. Kemudian dalam rangka melaksanakan . Instruksi Presiden Nomor 9 Tahun 2011 tentang Rencana Aksi Pencegahan dan Pemerantasan Korupsi Tahun 2011, Keputusan Presiden tersebut direvitalisasi dan diganti dengan Peraturan Presiden Nomor 33 Tahun 2012 tentang Jaringan Dokumentasi dan Informasi Hukum Nasional, Lembaran Negara No 82.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Untuk menyesuaikan dengan perkembangan ilmu pengetahuan dan teknologi, Manual Unit Jaringan Dokumentasi dan Informasi Hukum juga telah direvisi dan dikembangkan oleh Pusat Jaringan dan dijadikan lampiran yang tidak terpisahkan dari Peraturan Menteri Hukum dan HAM Nomor 02 Tahun 2013 Tentang Standardisasi Pengelolaan Teknis Dokumentasi Dan Informasi Hukum, yang selanjutnya dicabut dengan Peraturan Menteri Hukum dan HAM Nomor 8 Tahun 2019 Tentang Standar Pengelolaan Dokumen dan Informasi Hukum, ini dimaksudkan sebagai pedoman yang wajib digunakan oleh Anggota Jaringan Dokumentasi dan Informasi Hukum Nasional. Standar Pengelolaan Dokumen dan Informasi Hukum&nbsp;meliputi:</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Standar Pembuatan Abstrak Peraturan Perundang-undangan;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Standar Pengolahan Dokumen dan Informasi Hukum;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Standar Laporan Evaluasi Pengelolaan Jaringan Dokumentasi dan Informasi Hukum Nasional</span></li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Pasal 4 Peraturan Presiden Nomor 33 Tahun 2012 menetapkan kembali BPHN sebagai Pusat JDIHN dan Anggota JDIHN terdiri dari:</span></p>\r\n\r\n<p style=\"margin-left: 31.5pt; text-align: justify;\"><span style=\"color:#000000;\">1. Biro Hukum dan/atau unit kerja yang tugas dan fungsinya menyelenggarakan kegiatan yang berkaitan dengan dokumen hukum pada:</span></p>\r\n\r\n<ol style=\"list-style-type: lower-alpha; margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Kementerian Negara;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Sekretariat Lembaga Negara;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Lembaga Pemerintah Non Kementerian;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Pemerintah Provinsi;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Pemerintah Kabupaten/Kota; dan</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">Sekreariat Dewan Perwakilan Rakyat Daerah Tingkat Provinsi dan Kabupaten/Kota.</span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left: 40px; text-align: justify;\"><span style=\"color:#000000;\">2. Perpustakaan pada perguruan tinggi negeri dan perguruan tinggi swasta;</span></p>\r\n\r\n<p style=\"margin-left: 31.5pt; text-align: justify;\"><span style=\"color:#000000;\">3. Lembaga Lain yang bergerak di bidang pengembangan dokumentasi dan informasi hukum yang ditetapkan olen Menteri.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Pasal 3 Peraturan Presiden Nomor 33 Tahun 2012 menegaskan bahwa tujuan dari JDIHN adalah:</span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha;\">\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">menjamin terciptanya Pengelolaan Dokumentasi dan Informasi Hukum yang terpadu dan terintegrasi di berbagai instansi pemerintah dan institusi lainnya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">menjamin ketersediaan dokumentasi dan informasi hukum yang lengkap dan akurat, serta dapat diakses secara cepat dan mudah;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">mengembangkan kerja sama yang efektif antara Pusat jaringan dan Anggota jaringan serta antar sesama Anggota jaringan dalam rangka penyediaan dokumentasi dan informasi hukum; dan</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000;\">meningkatkan kualitas pembangunan hukum nasional dan pelayanan kepada publik sebagai salah satu wujud ketatapemerintahan yang baik, transparan, efektif, efisien, dan bertanggung jawab.</span></li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\">Sejarah pembentukan JDIHN di atas menunjukkan betapa pentingnya kerjasama pengelolaan dokumen dan informasi hukum untuk mempercepat pembangunan hukum nasional yang berkualitas. Untuk membangun akses informasi hukum yang terintegrasi, secara nasional semua Anggota JDIHN wajib mengelola dokumen dan informasi hukum yang ada dalam kewenangannya dengan menggunakan modul/standar yang ada dan meningkatkan akselerasinya dengan memanfaatkan kecanggihan teknologi informasi dan komunikasi. Tersedianya akses informasi hukum bagi semua warga negara merupakan conditio sine quanon dalam mewujudkan supremasi hukum. Sementara menyediakan akses informasi hukum adalah tugas dari dokumentasi hukum Anggota Jaringan.</span></p>\r\n\r\n<p>&nbsp;</p>', 1);
